import React from 'react';
import classes from './Project.module.css';

const user = (props) => (
  <figure>
    <a href={props.url}>
      <img className={classes.Img} src={props.image} alt={props.alt} />
    </a>
    <figcaption>{props.description}</figcaption>
  </figure>
);

export default user;
